executeFunc(initOrderPackage);function initOrderPackage(){let orderpackageWarehouse=document.getElementById("package_orders_form_profile");if(orderpackageWarehouse===null){return false}orderpackageWarehouse.addEventListener("change",changeObjectPackageWarehouse,false);let productsCount=document.querySelectorAll(".product-total").length;for(let key=0;key<productsCount;key++){let total=parseInt(document.getElementById(`package_orders_form_products_${key}_total`).value);let stock=parseInt(document.getElementById(`package_orders_form_products_${key}_stock`).value);let submitButton=document.getElementById("package_orders_form_package");if(total>stock&&false===submitButton.classList.contains("disabled")){submitButton.classList.add("disabled");return false}if(total<=stock&&true===submitButton.classList.contains("disabled")){submitButton.classList.remove("disabled");submitButton.disabled=false}}let forms=document.forms.package_orders_form;forms.addEventListener("submit",(function(event){event.preventDefault();submitModalForm(forms);return true}));return true}function changeObjectPackageWarehouse(){const requestModalName=new XMLHttpRequest;requestModalName.responseType="document";let PackageOrderForm=document.forms.package_orders_form;disabledElementsForm(PackageOrderForm);let formData=new FormData(PackageOrderForm);formData.delete(PackageOrderForm.name+"[_token]");requestModalName.open(PackageOrderForm.getAttribute("method"),PackageOrderForm.getAttribute("action"),true);requestModalName.setRequestHeader("X-Requested-With","XMLHttpRequest");requestModalName.addEventListener("readystatechange",(function(){enableElementsForm(PackageOrderForm);if(requestModalName.readyState===4&&requestModalName.status===200){let result=requestModalName.response.getElementById("modal-body");result.querySelectorAll('[data-select="select2"]').forEach((function(item){new NiceSelect(item,{searchable:true})}));document.getElementById("modal-body").replaceWith(result);initOrderPackage()}return false}));requestModalName.send(formData)}